        private void btnZoomOut_Click(object sender, EventArgs e)
        {
            try
            {
                float liNewZoom = 0;
                if (igCurrZoom != kigZoomSteps[0])
                {
                    for (int i = 1; i < kigZoomSteps.Count(); i++)
                    {
                        if (igCurrZoom > kigZoomSteps[i - 1] && igCurrZoom <= kigZoomSteps[i])
                        {
                            liNewZoom = kigZoomSteps[i - 1];
                        }
                    }
                    ZoomTo(liNewZoom);
                }
            }
            catch (Exception ex)
            {
            }
        }

        private void btnZoomIn_Click(object sender, EventArgs e)
        {
            try
            {
                float liNewZoom = 0;
                if (igCurrZoom != kigZoomSteps[kigZoomSteps.Count() - 1])
                {
                    for (int i = 1; i < kigZoomSteps.Count(); i++)
                    {
                        if (igCurrZoom >= kigZoomSteps[i - 1] && igCurrZoom < kigZoomSteps[i])
                        {
                            liNewZoom = kigZoomSteps[i];
                        }
                    }
                    ZoomTo(liNewZoom);
                }
            }
            catch (Exception ex)
            {
            }
        }

