        private void FitImage()
        {
            try
            {
                if (picImg.Image != null)
                {
                    picImg.Visible = false;
                    if ((panel1.Width - panel1.Margin.Left - panel1.Margin.Right) / (double)ilOriWidth <
                        (panel1.Height - panel1.Margin.Top - panel1.Margin.Bottom) / (double)ilOriHeight)
                    {
                        igCurrZoom = (float)Math.Floor(100 * ((double)(panel1.Width - panel1.Margin.Left - panel1.Margin.Right) / ilOriWidth));
                    }
                    else
                    {
                        igCurrZoom = (float)Math.Floor(100 * ((double)(panel1.Height - panel1.Margin.Top - panel1.Margin.Bottom) / ilOriHeight));
                    }

                    picImg.Width = (int)((igCurrZoom / 100) * ilOriWidth);
                    picImg.Height = (int)((igCurrZoom / 100) * ilOriHeight);
                    picImg.Visible = true;
                }
            }
            catch (Exception ex)
            {
            }
        }

        private void ZoomTo(float agNewZoom)
        {
            var vScrollPercent = ((double)panel1.VerticalScroll.Value / panel1.VerticalScroll.Maximum) * 100;
            var hScrollPercent = ((double)panel1.HorizontalScroll.Value / panel1.HorizontalScroll.Maximum) * 100;
            picImg.Visible = false;

            if (agNewZoom != igCurrZoom)
            {
                if (agNewZoom <= kiiMinZoom)
                {
                    agNewZoom = kiiMinZoom;
                }
                else if (agNewZoom > kiiMaxZoom)
                {
                    agNewZoom = kiiMaxZoom;
                }

                if ((long)(ilOriWidth * agNewZoom / 100) * (long)(ilOriHeight * agNewZoom / 100) > kilMaxImageSizePixel)
                {
                    //There will be not enough VB internal memory for enlarging the photo
                }
                else
                {
                    igCurrZoom = agNewZoom;
                    //picEx.Picture = picExBack.Picture;
                }

                //Change brightness & contrast is very slow
                //ChangeBrightnessContrast(currentBrightness, currentContrast);
            }

            picImg.Visible = true;
            //picContainer_Resize

            picImg.Width = (int)(ilOriWidth * (igCurrZoom / 100));
            picImg.Height = (int)(ilOriHeight * (igCurrZoom / 100));
            var vPos = (int)((vScrollPercent / 100.0) * panel1.VerticalScroll.Maximum);
            var hPos = (int)((hScrollPercent / 100.0) * panel1.HorizontalScroll.Maximum);
            //infinite loop when location at bottom right
            //while (panel1.VerticalScroll.Value != vPos || panel1.HorizontalScroll.Value != hPos)
            //{
            //    panel1.VerticalScroll.Value = vPos;
            //    panel1.HorizontalScroll.Value = hPos;
            //}
            //set once don't work, need to set value twice
            panel1.VerticalScroll.Value = vPos;
            panel1.HorizontalScroll.Value = hPos;
            panel1.VerticalScroll.Value = vPos;
            panel1.HorizontalScroll.Value = hPos;
        }

