        private void PicImg_MouseWheel(object sender, MouseEventArgs e)
        {
            try
            {
                ((HandledMouseEventArgs)e).Handled = true;
                if (picImg.Image != null && picImg.Enabled)
                {
                    //wheel scroll up
                    if (e.Delta > 0)
                    {
                        ZoomTo(igCurrZoom + 1);
                    }
                    //wheel scroll down
                    else
                    {
                        ZoomTo(igCurrZoom - 1);
                    }
                }
            }
            catch (Exception ex)
            {
            }
        }

