                this.PreviewPDF();
            }
        }


        private void PreviewImage()
        {
            this.panel1.Visible = true;
            this.picImg.Visible = true;
            this.webView.Visible = false;

            // hide first row
            // RowStyles index is index of the row you are dealing with
            tableLayoutPanel.RowStyles[0].SizeType = SizeType.Absolute;
            tableLayoutPanel.RowStyles[0].Height = 35;

            Image image = this.LoadImage();
            picImg.Image = image;

            ilOriWidth = picImg.Image == null ? 0 : picImg.Image.Width;
            ilOriHeight = picImg.Image == null ? 0 : picImg.Image.Height;

            igCurrZoom = 100;

            currentContrast = 50;
            currentBrightness = 50;

            this.FitImage();
        }
        private void PreviewPDF()
        {
            this.panel1.Visible = false;
            this.picImg.Visible = false;
            this.webView.Visible = true;

            // hide first row
            // RowStyles index is index of the row you are dealing with
            tableLayoutPanel.RowStyles[0].SizeType = SizeType.Absolute;
            tableLayoutPanel.RowStyles[0].Height = 0;

            this.InitializeWebView2();
        }


